import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 360px;
  margin-bottom: 90px;
  cursor: pointer;
`;

const Img = styled.img`
  height: 100%;
  height: 202px;
  background-color: #999;
`;


const Card = () => {
  return <Container>Card</Container>;
};

export default Card;
